var doc = new jsPDF( 'landscape' );        

// Demo Data
var data = {
	host_name	: 'Adrian',
    host_gender : 'male',
	host_age	: '6',
	host_phone	: '0676 / 969 05 11',
	host_email	: 'me@adrianhana.com',
	
	friends		: [ 'Joe', 'Enrique' ],
	message		: '',
	date		: 'Do, 22.10.2015',
	time		: '16:00 Uhr',
	location	: 'luftburg',
	
	template	: 'fancy', // can be fancy or lite
	qr			: true
};

// Images    
var cover_fancy		= 'data:image/jpeg;base64,';
var cover_lite		= 'data:image/jpeg;base64,';

var qrcode_lb		= 'data:image/jpeg;base64,';
var qrcode_pf		= 'data:image/jpeg;base64,';

// Loop
$.each( data.friends, function( index, friend ) {
            
    if( index > 0 )
		doc.addPage();
    
	// Texts	
    var intro			= 'Hallo ' + friend + ',\n\n\Bald feiere ich meinen Geburtstag\nund wrde mich sehr freuen\nwenn du auch kommst!\n\nDein ' + data.host_name;
    var intro_age		= 'Hallo ' + friend + ',\n\n\Bald feiere ich meinen ' + ( parseInt(data.host_age) + 1 ) + '. Geburtstag\nund wrde mich sehr freuen\nwenn du auch kommst!';
    var info			= 'Bitte lass mich wissen ob du kommen kannst unter ' + data.host_phone + ' oder ' + data.host_email;
    
    if( data.host_gender == 'male' ) {
        var greetings       = 'Dein ' + data.host_name;
    } else if( data.host_gender == 'female' ) {
        var greetings       = 'Deine ' + data.host_name;
	}

// PDF Size is 297x210
    
	// add cover image
    if( data.template == 'fancy' ) {
        doc.addImage( cover_fancy, 'JPEG', 0, 0, 148.5, 210 );
	} else if( data.template == 'lite' ) {
        doc.addImage( cover_lite, 'JPEG', 0, 0, 148.5, 210 );
	}
    
	// set text color to gray
    doc.setTextColor( 100 );

    doc.setFontSize( 16 );
	
	if( data.host_age != '' ) {
        
		intro_age = doc.splitTextToSize( intro_age, 100 );
        
        //var y = 35;
        
        //$.each(intro_age, function( index, value ) {
        	//doc.text(value, 220.75, y, 0, 0, 'center');
            //y += 7;
        //});

        
		doc.text( intro_age, 174.25, 40 );
        doc.text( greetings, 174.25, 75 );
        
	} else {
        
		intro = doc.splitTextToSize( intro, 100 );
        
        //var y = 35;
        
        //$.each(intro, function( index, value ) {
            //doc.text(value, 220.75, y, 0, 0, 'center');
            //y += 7;
        //});	}
        
        doc.text( intro, 174.25, 40 );
        doc.text( greetings, 174.25, 75 );
        
	}
    
    doc.setDrawColor( 200 );
	doc.setLineWidth( 0.1 );
    doc.line( 174.25, 90, 274.25, 90 );
    doc.line( 174.25, 145, 274.25, 145 );

    doc.setFontSize( 16);
	doc.setTextColor( 255,146,38 );
    doc.text( doc.splitTextToSize( "WANN?", 100 ), 174.25, 100 );
    
	doc.setFontSize( 14 );
	doc.setTextColor( 100 );
    doc.text( doc.splitTextToSize( data.date + ' - ' + data.time, 100 ), 174.25, 106 );
	
    doc.setFontSize(16);
	doc.setTextColor(255,146,38);
    doc.text( doc.splitTextToSize( "WO?", 100 ), 174.25, 120 );
	
    doc.setFontSize( 14 );
	doc.setTextColor( 100 );
	
	// add address & qr code
	if( data.location == 'luftburg' ) {
		doc.text( doc.splitTextToSize( 'Kolariks Luftburg,\nPrater 121, An der Hauptallee,\nA-1020 Wien', 100 ), 174.25, 126 );
		if( data.qr == true )
            doc.addImage( qrcode_lb, 'JPEG', 209.75, 150, 30, 30 );
	} else if( data.location == 'praterfee' ) {
		doc.text( doc.splitTextToSize( 'Praterfee', 100), 174.25, 126 );
		if( data.qr == true )
            doc.addImage( qrcode_pf, 'JPEG', 209.75, 150, 30, 30 );
	}

	// add info
    doc.setFontSize( 12 );
    info = doc.splitTextToSize( info, 100 );
    doc.text( info, 174.25, 190 );
		
});